import React, {useEffect, useState} from 'react';


const Todo = () =>{
    const [check, setCheck] = useState('');

    useEffect(()=>{
       if(!check){
        setCheck('')
       }
    },[check])

    return(
        <div>
            <h3>Todo App</h3>
            <div style={{border:"solid black",display:"flex",justifyContent:"space-between",alignItems:"center"}}>
                <div style={{display:"flex"}}>
                <input type="checkbox" id="vehicle1" name="vehicle1" value="Bike" onClick={()=>(setCheck('completed'))}/>
                {/* <div onClick={()=>(setCheck('completed'))}>click me</div> */}
                <label> I have a bike</label>
                </div>
                <div>
                {check}
                </div>
            </div>
        </div>
    )
}

export default Todo;
